import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { useEffect } from 'react';
import api from '../../../../components/API/API';
import DeleteOutline from '@mui/icons-material/DeleteOutline';


import RemoveRedEyeIcon from '@mui/icons-material/RemoveRedEye';
export default function Userlist() {
    const [rows,setRows]=React.useState([])

    useEffect(() => {
        const getdata=async()=>{
       const data= await api.get('/alluser').then(
            )

            console.log(data.data);
            setRows(data.data)



        }
        getdata()
      },[]);

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead style={{background:"#007bff",color:"white"}}>
          <TableRow>
            <TableCell style={{color:"white"}}>Full name</TableCell>
            <TableCell style={{color:"white"}} align="right">Email</TableCell>
            <TableCell style={{color:"white"}} align="right">Status</TableCell>
            <TableCell style={{color:"white"}}  align="right">Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
            >
              <TableCell component="th" scope="row">
                {row.name} {row.lastname}
              </TableCell>
              <TableCell align="right">{row.email}</TableCell>
              <TableCell align="right">{row.status}</TableCell>
              <TableCell align="right"><DeleteOutline /> <RemoveRedEyeIcon /></TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
